import React, {Component} from "react";
import axios from "axios";
import DangerFeedback from "./Feedback/DangerFeedback";
import LoadingSpinnerPrimaryLongBtn from "./Spinners/LoadingSpinnerPrimaryLongBtn";

class CheckOut extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        return (
           <div className="backgroundContainer opacity-2">
               <div className="row opacity-5 justify-content-center mt-5">
                   <div className="col-sm-8 bg-light mt-5">
                       <div className="CheckOutContainer">
                           <h1>Hello world!</h1>
                       </div>
                   </div>
               </div>

           </div>
        );
    }
}

export default CheckOut;
